#include <math.h>
#include <stdio.h>
#define NRANSI
#include "nrutilD.h"
#include "Variables.h"

/* Define constants appearing in the parametrization (R,Theta) -> (r,h), critical exponents, 
		and combinations thereof (the c's coefficients), and PI */
#define A -0.76201
#define B 0.00804
#define beta 0.326
#define delta 4.8
#define alpha 0.11
#define M0 0.605
#define h0 0.364
#define c0 0.0424369
#define c1 0.321329
#define c2 -1.20375
#define c3 -0.00126032
#define bede 1.5648
#define PI 3.141592653589

int a1,a2,a3,a4,a5;


/* Define a function that determines the choice of initial conditions in the root finding process leading to
		the (R,Theta) -> (T,muB) map. It is the equation of the straight line corresponding to Theta=0, 
		separating {h > 0, Theta > 0} from {h < 0, Theta < 0}. */
double condition(double x){
	return TC + muBC*tan(angle1) - tan(angle1)*x;
}

/* Define the functions relating QCD variable to the parameters (R,Theta), which need to be solved to find the map. */
void funcv(int n,double x[],double f[])
{
	f[1] = TC + x[1]*(1.0-x[2]*x[2])*sin(angle1)*dmuBC 
			+ h0*pow(x[1],bede)*x[2]*(1.0 + A*pow(x[2],2) + B*pow(x[2],4))*sin(angle2)*dTC - Ti;
	f[2] = muBC - x[1]*(1.0-x[2]*x[2])*cos(angle1)*dmuBC 
			- h0*pow(x[1],bede)*x[2]*(1.0 + A*pow(x[2],2) + B*pow(x[2],4))*cos(angle2)*dTC - muBi;
}

/* Define the routine calculating the Jacobian from the choice of parameters in the Ising -> QCD map */
void Jacobian (double **JJ, double dTC, double dmuBC, double angle1, double angle2){
	if(angle1 != 0 && angle1 != PI/2 && angle2 != 0 && angle2 != PI/2){
		JJ[1][1] = 1.0/dmuBC * cos(angle2)/(cos(angle2)*sin(angle1) - cos(angle1)*sin(angle2));
		JJ[1][2] = 1.0/dmuBC * sin(angle2)/(cos(angle2)*sin(angle1) - cos(angle1)*sin(angle2));
		JJ[2][1] = 1.0/dTC * cos(angle1)/(- cos(angle2)*sin(angle1) + cos(angle1)*sin(angle2));
		JJ[2][2] = 1.0/dTC * sin(angle1)/(- cos(angle2)*sin(angle1) + cos(angle1)*sin(angle2));
	}
	if(angle1 == 0 && angle2 ==0){
		printf("Jacobian matrix is singular! Exiting.. \n");
		return;
	}
	if(angle1 == 0 && angle2 != 0 && angle2 != PI/2){
		JJ[1][1] = -1.0/dmuBC*cos(angle2)/sin(angle2);
		JJ[1][2] = -1.0/dmuBC;
		JJ[2][1] = 1.0/dTC*1.0/sin(angle2);
		JJ[2][2] = 0.0;
	}
	if(angle1 != 0 && angle1 != PI/2 && angle2 == PI/2){
		JJ[1][1] = 0.0;
		JJ[1][2] = -1.0/dmuBC*1.0/cos(angle1);
		JJ[2][1] = 1.0/dTC;
		JJ[2][2] = 1.0/dTC*sin(angle1)/cos(angle1);
	}
	if(angle1 == 0 && angle2 == PI/2){
		JJ[1][1] = 0.0;
		JJ[1][2] = -1.0/dmuBC;
		JJ[2][1] = 1.0/dTC;
		JJ[2][2] = 0.0;
	}
	else{}

	return  ;
}

double G(double R, double Theta){

	gg0Num = c0 + c1*(1-Theta*Theta) + c2*(1-Theta*Theta)*(1-Theta*Theta) + 
  			c3*(1-Theta*Theta)*(1-Theta*Theta)*(1-Theta*Theta);
	htil0Num = Theta + A*Theta*Theta*Theta + B*Theta*Theta*Theta*Theta*Theta;

	return h0*M0*pow(R,2.0-alpha)*(gg0Num - Theta*htil0Num);
}

double dGdmuBConT (double R, double Theta){

  // gg, htil and derivatives
  gg0Num = c0 + c1*(1-Theta*Theta) + c2*(1-Theta*Theta)*(1-Theta*Theta) + 
        c3*(1-Theta*Theta)*(1-Theta*Theta)*(1-Theta*Theta);
  gg1Num = - 2*c1*Theta - 4*c2*Theta*(1-Theta*Theta) - 6*c3*Theta*(1-Theta*Theta)*(1-Theta*Theta);
  htil0Num = Theta + A*Theta*Theta*Theta + B*Theta*Theta*Theta*Theta*Theta;
  htil1Num = 1 + 3*A*Theta*Theta + 5*B*Theta*Theta*Theta*Theta;

  // Derivatives of G wrt R, Theta
  dGdRNum = h0*M0*(2-alpha)*pow(R,1.0-alpha)*(gg0Num - Theta*htil0Num);
  dGdThetaNum = h0*M0*pow(R,2.0-alpha)*(gg1Num - htil0Num - Theta*htil1Num);

  // Derivatives of Theta wrt R and vice versa at constant r,h
  dThetadRConhNum = -beta*delta*htil0Num/(R*htil1Num);
  dRdThetaConhNum = -R*htil1Num/(beta*delta*htil0Num);
  dThetadRConrNum = (1-Theta*Theta)/(2*Theta*R);
  dRdThetaConrNum = 2*Theta*R/(1-Theta*Theta);

  // Derivatives of r,h wrt R,Theta
  drdRConhNum = 1 - Theta*Theta - 2*R*Theta*dThetadRConhNum;
  drdThetaConhNum = - 2*Theta*R + (1-Theta*Theta)*dRdThetaConhNum;
  dhdRConrNum = beta*delta*h0*pow(R,- 1 + beta*delta)*htil0Num +
                     h0*pow(R,beta*delta)*htil1Num*dThetadRConrNum;
  dhdThetaConrNum = beta*delta*h0*pow(R,- 1 + beta*delta)*htil0Num*dRdThetaConrNum +
                     h0*pow(R,beta*delta)*htil1Num;

  // Derivatives of R,Theta wrt r,h
  dRdrConhNum = 1./drdRConhNum;
  dThetadrConhNum = 1./drdThetaConhNum;
  dRdhConrNum = 1./dhdRConrNum;
  dThetadhConrNum = 1./dhdThetaConrNum;

  // Derivatives of G wrt r,h
  dGdrConhNum = dGdRNum*dRdrConhNum + dGdThetaNum*dThetadrConhNum;
  dGdhConrNum = dGdRNum*dRdhConrNum + dGdThetaNum*dThetadhConrNum;

  // Finally, derivative of G wrt muB
  return dGdrConhNum*drdmuB + dGdhConrNum*dhdmuB;
}

double dGdTConmuB (double R, double Theta){

  // gg, htil and derivatives
  gg0Num = c0 + c1*(1-Theta*Theta) + c2*(1-Theta*Theta)*(1-Theta*Theta) + 
        c3*(1-Theta*Theta)*(1-Theta*Theta)*(1-Theta*Theta);
  gg1Num = - 2*c1*Theta - 4*c2*Theta*(1-Theta*Theta) - 6*c3*Theta*(1-Theta*Theta)*(1-Theta*Theta);
  htil0Num = Theta + A*Theta*Theta*Theta + B*Theta*Theta*Theta*Theta*Theta;
  htil1Num = 1 + 3*A*Theta*Theta + 5*B*Theta*Theta*Theta*Theta;

  // Derivatives of G wrt R, Theta
  dGdRNum = h0*M0*(2-alpha)*pow(R,1.0-alpha)*(gg0Num - Theta*htil0Num);
  dGdThetaNum = h0*M0*pow(R,2.0-alpha)*(gg1Num - htil0Num - Theta*htil1Num);

  // Derivatives of Theta wrt R and vice versa at constant r,h
  dThetadRConhNum = -beta*delta*htil0Num/(R*htil1Num);
  dRdThetaConhNum = -R*htil1Num/(beta*delta*htil0Num);
  dThetadRConrNum = (1-Theta*Theta)/(2*Theta*R);
  dRdThetaConrNum = 2*Theta*R/(1-Theta*Theta);

  // Derivatives of r,h wrt R,Theta
  drdRConhNum = 1 - Theta*Theta - 2*R*Theta*dThetadRConhNum;
  drdThetaConhNum = - 2*Theta*R + (1-Theta*Theta)*dRdThetaConhNum;
  dhdRConrNum = beta*delta*h0*pow(R,- 1 + beta*delta)*htil0Num +
                     h0*pow(R,beta*delta)*htil1Num*dThetadRConrNum;
  dhdThetaConrNum = beta*delta*h0*pow(R,- 1 + beta*delta)*htil0Num*dRdThetaConrNum +
                     h0*pow(R,beta*delta)*htil1Num;

  // Derivatives of R,Theta wrt r,h
  dRdrConhNum = 1./drdRConhNum;
  dThetadrConhNum = 1./drdThetaConhNum;
  dRdhConrNum = 1./dhdRConrNum;
  dThetadhConrNum = 1./dhdThetaConrNum;

  // Derivatives of G wrt r,h
  dGdrConhNum = dGdRNum*dRdrConhNum + dGdThetaNum*dThetadrConhNum;
  dGdhConrNum = dGdRNum*dRdhConrNum + dGdThetaNum*dThetadhConrNum;

  // Finally, derivative of G wrt muB
  return dGdrConhNum*drdT + dGdhConrNum*dhdT;
}

double d2GdmuB2ConT(double R, double Theta){

	// gg, htil and derivatives
	gg0Num = c0 + c1*(1-Theta*Theta) + c2*(1-Theta*Theta)*(1-Theta*Theta) + 
  			c3*(1-Theta*Theta)*(1-Theta*Theta)*(1-Theta*Theta);
	gg1Num = - 2*c1*Theta - 4*c2*Theta*(1-Theta*Theta) - 6*c3*Theta*(1-Theta*Theta)*(1-Theta*Theta);
	gg2Num = - 2*c1 + c2*(8*Theta*Theta - 4*(1-Theta*Theta)) + c3*(24*Theta*Theta*(1-Theta*Theta)
  															 - 6*(1-Theta*Theta)*(1-Theta*Theta));
	htil0Num = Theta + A*Theta*Theta*Theta + B*Theta*Theta*Theta*Theta*Theta;
	htil1Num = 1 + 3*A*Theta*Theta + 5*B*Theta*Theta*Theta*Theta;
	htil2Num = 6*A*Theta + 20*B*Theta*Theta*Theta;

	// Derivatives of G wrt R, Theta
	d2GdR2Num = h0*M0*(2-alpha)*(1-alpha)*pow(R,-alpha)*(gg0Num - Theta*htil0Num);
	d2GdTheta2Num = h0*M0*pow(R,2.0-alpha)*(gg2Num - 2*htil1Num - Theta*htil2Num);
	d2GdRdThetaNum = h0*M0*(2-alpha)*pow(R,1.0-alpha)*(gg1Num - htil0Num - Theta*htil1Num);
	dGdRNum = h0*M0*(2-alpha)*pow(R,1.0-alpha)*(gg0Num - Theta*htil0Num);
	dGdThetaNum = h0*M0*pow(R,2.0-alpha)*(gg1Num - Theta*htil1Num - htil0Num);

  // Derivatives of Theta wrt R and vice versa at constant r,h
	dThetadRConhNum = -beta*delta*htil0Num/(R*htil1Num);
	dRdThetaConhNum = -R*htil1Num/(beta*delta*htil0Num);
	dThetadRConrNum = (1-Theta*Theta)/(2*Theta*R);
	dRdThetaConrNum = 2*Theta*R/(1-Theta*Theta);

	// Derivatives of r,h wrt R,Theta
	drdRConhNum = 1 - Theta*Theta - 2*R*Theta*dThetadRConhNum;
	drdThetaConhNum = - 2*Theta*R + (1-Theta*Theta)*dRdThetaConhNum;
	dhdRConrNum = beta*delta*h0*pow(R,- 1 + beta*delta)*htil0Num +
										 h0*pow(R,beta*delta)*htil1Num*dThetadRConrNum;
	dhdThetaConrNum = beta*delta*h0*pow(R,- 1 + beta*delta)*htil0Num*dRdThetaConrNum +
										 h0*pow(R,beta*delta)*htil1Num;
	d2rdR2ConhNum = 2*beta*delta*htil0Num/(R*htil1Num*htil1Num*htil1Num)*(htil1Num*(Theta*htil1Num
			- beta*delta*(htil0Num + Theta*htil1Num)) + beta*delta*Theta*htil0Num*htil2Num);
	d2rdTheta2ConhNum = R/(beta*beta*delta*delta*htil0Num*htil0Num)*(- 2*beta*beta*delta*delta*htil0Num*htil0Num
			- (-1+Theta*Theta)*htil1Num*(htil1Num + beta*delta*htil1Num)
			+ beta*delta*htil0Num*(4*Theta*htil1Num + (-1+Theta*Theta)*htil2Num));
	d2hdR2ConrNum = h0*pow(R,- 2 + beta*delta)/(4*Theta*Theta*Theta)*(4*beta*delta*(- 1 + beta*delta)*Theta*Theta*Theta
				*htil0Num + (-1+Theta*Theta)*((1 + (3 - 4*beta*delta)*Theta*Theta)*htil1Num
			+ Theta*(-1+Theta*Theta)*htil2Num));
	d2hdTheta2ConrNum = h0*pow(R,beta*delta)/((-1+Theta*Theta)*(-1+Theta*Theta))*(2*beta*delta*(1 + (1 + 2*beta*delta)
				*Theta*Theta)*htil0Num + (-1+Theta*Theta)*(- 4*beta*delta*Theta*htil1Num
			+ (-1+Theta*Theta)*htil2Num));

	// Derivatives of R,Theta wrt r,h
	dRdrConhNum = 1./drdRConhNum;
	dThetadrConhNum = 1./drdThetaConhNum;
	dRdhConrNum = 1./dhdRConrNum;
	dThetadhConrNum = 1./dhdThetaConrNum;
	d2Rdr2ConhNum = - d2rdR2ConhNum*dRdrConhNum*dRdrConhNum*dRdrConhNum;
	d2Thetadr2ConhNum = - d2rdTheta2ConhNum*dThetadrConhNum*dThetadrConhNum*dThetadrConhNum;
	d2Rdh2ConrNum = - d2hdR2ConrNum*dRdhConrNum*dRdhConrNum*dRdhConrNum;
	d2Thetadh2ConrNum = - d2hdTheta2ConrNum*dThetadhConrNum*dThetadhConrNum*dThetadhConrNum;
	d2RdrdhNum = pow(R, - beta*delta)*(2*(- 1 + beta*delta)*Theta*(-1+Theta*Theta)*htil1Num*htil1Num 
			- 2*beta*delta*htil0Num*(htil1Num + Theta*(2*(- 1 + beta*delta)*Theta*htil1Num 
			+ (1 - 2*beta*delta)*Theta*htil1Num + (-1+Theta*Theta)*htil2Num)))/(h0*(2*beta*delta*Theta*htil0Num 
			+ htil1Num - Theta*Theta*htil1Num)*(- 2*beta*delta*Theta*htil0Num + (-1+Theta*Theta)*htil1Num)
				*(- 2*beta*delta*Theta*htil0Num + (-1+Theta*Theta)*htil1Num));
	d2ThetadrdhNum = beta*delta*pow(R,- 1 - beta*delta)*(2*beta*delta*(1+Theta*Theta)*htil0Num*htil0Num
			- (-1+Theta*Theta)*(-1+Theta*Theta)*htil1Num*htil1Num + (-1+Theta*Theta)*htil0Num
				*(-1+Theta*Theta)*htil2Num)/(h0*(2*beta*delta*Theta*htil0Num + htil1Num
			- Theta*Theta*htil1Num)*(- 2*beta*delta*Theta*htil0Num + (-1+Theta*Theta)*htil1Num)
				*(- 2*beta*delta*Theta*htil0Num + (-1+Theta*Theta)*htil1Num));

	// Derivatives of G wrt r,h
	d2Gdr2ConhNum =	d2GdR2Num*dRdrConhNum*dRdrConhNum 
			+ d2GdTheta2Num*dThetadrConhNum*dThetadrConhNum 
			+ 2*d2GdRdThetaNum*dRdrConhNum*dThetadrConhNum
			+ dGdRNum*d2Rdr2ConhNum + dGdThetaNum*d2Thetadr2ConhNum;
	d2Gdh2ConrNum = d2GdR2Num*dRdhConrNum*dRdhConrNum 
			+ d2GdTheta2Num*dThetadhConrNum*dThetadhConrNum 
			+ 2*d2GdRdThetaNum*dRdhConrNum*dThetadhConrNum
			+ dGdRNum*d2Rdh2ConrNum + dGdThetaNum*d2Thetadh2ConrNum;
	d2GdrdhNum = d2GdR2Num*dRdhConrNum*dRdrConhNum
			+ d2GdTheta2Num*dThetadhConrNum*dThetadrConhNum 
			+ d2GdRdThetaNum*(dRdhConrNum*dThetadrConhNum + dRdrConhNum*dThetadhConrNum)
			+ dGdRNum*d2RdrdhNum + dGdThetaNum*d2ThetadrdhNum;

	// Finally, derivative of G wrt muB
	return d2Gdr2ConhNum*drdmuB*drdmuB + d2Gdh2ConrNum*dhdmuB*dhdmuB 
			+ 2*d2GdrdhNum*drdmuB*dhdmuB;
}

double d2GdT2ConmuB(double R, double Theta){

  // gg, htil and derivatives
  gg0Num = c0 + c1*(1-Theta*Theta) + c2*(1-Theta*Theta)*(1-Theta*Theta) + 
        c3*(1-Theta*Theta)*(1-Theta*Theta)*(1-Theta*Theta);
  gg1Num = - 2*c1*Theta - 4*c2*Theta*(1-Theta*Theta) - 6*c3*Theta*(1-Theta*Theta)*(1-Theta*Theta);
  gg2Num = - 2*c1 + c2*(8*Theta*Theta - 4*(1-Theta*Theta)) + c3*(24*Theta*Theta*(1-Theta*Theta)
                                 - 6*(1-Theta*Theta)*(1-Theta*Theta));
  htil0Num = Theta + A*Theta*Theta*Theta + B*Theta*Theta*Theta*Theta*Theta;
  htil1Num = 1 + 3*A*Theta*Theta + 5*B*Theta*Theta*Theta*Theta;
  htil2Num = 6*A*Theta + 20*B*Theta*Theta*Theta;

  // Derivatives of G wrt R, Theta
  d2GdR2Num = h0*M0*(2-alpha)*(1-alpha)*pow(R,-alpha)*(gg0Num - Theta*htil0Num);
  d2GdTheta2Num = h0*M0*pow(R,2.0-alpha)*(gg2Num - 2*htil1Num - Theta*htil2Num);
  d2GdRdThetaNum = h0*M0*(2-alpha)*pow(R,1.0-alpha)*(gg1Num - htil0Num - Theta*htil1Num);
  dGdRNum = h0*M0*(2-alpha)*pow(R,1.0-alpha)*(gg0Num - Theta*htil0Num);
  dGdThetaNum = h0*M0*pow(R,2.0-alpha)*(gg1Num - Theta*htil1Num - htil0Num);

  // Derivatives of Theta wrt R and vice versa at constant r,h
  dThetadRConhNum = -beta*delta*htil0Num/(R*htil1Num);
  dRdThetaConhNum = -R*htil1Num/(beta*delta*htil0Num);
  dThetadRConrNum = (1-Theta*Theta)/(2*Theta*R);
  dRdThetaConrNum = 2*Theta*R/(1-Theta*Theta);

  // Derivatives of r,h wrt R,Theta
  drdRConhNum = 1 - Theta*Theta - 2*R*Theta*dThetadRConhNum;
  drdThetaConhNum = - 2*Theta*R + (1-Theta*Theta)*dRdThetaConhNum;
  dhdRConrNum = beta*delta*h0*pow(R,- 1 + beta*delta)*htil0Num +
                     h0*pow(R,beta*delta)*htil1Num*dThetadRConrNum;
  dhdThetaConrNum = beta*delta*h0*pow(R,- 1 + beta*delta)*htil0Num*dRdThetaConrNum +
                     h0*pow(R,beta*delta)*htil1Num;
  d2rdR2ConhNum = 2*beta*delta*htil0Num/(R*htil1Num*htil1Num*htil1Num)*(htil1Num*(Theta*htil1Num
      - beta*delta*(htil0Num + Theta*htil1Num)) + beta*delta*Theta*htil0Num*htil2Num);
  d2rdTheta2ConhNum = R/(beta*beta*delta*delta*htil0Num*htil0Num)*(- 2*beta*beta*delta*delta*htil0Num*htil0Num
      - (-1+Theta*Theta)*htil1Num*(htil1Num + beta*delta*htil1Num)
      + beta*delta*htil0Num*(4*Theta*htil1Num + (-1+Theta*Theta)*htil2Num));
  d2hdR2ConrNum = h0*pow(R,- 2 + beta*delta)/(4*Theta*Theta*Theta)*(4*beta*delta*(- 1 + beta*delta)*Theta*Theta*Theta
        *htil0Num + (-1+Theta*Theta)*((1 + (3 - 4*beta*delta)*Theta*Theta)*htil1Num
      + Theta*(-1+Theta*Theta)*htil2Num));
  d2hdTheta2ConrNum = h0*pow(R,beta*delta)/((-1+Theta*Theta)*(-1+Theta*Theta))*(2*beta*delta*(1 + (1 + 2*beta*delta)
        *Theta*Theta)*htil0Num + (-1+Theta*Theta)*(- 4*beta*delta*Theta*htil1Num
      + (-1+Theta*Theta)*htil2Num));

  // Derivatives of R,Theta wrt r,h
  dRdrConhNum = 1./drdRConhNum;
  dThetadrConhNum = 1./drdThetaConhNum;
  dRdhConrNum = 1./dhdRConrNum;
  dThetadhConrNum = 1./dhdThetaConrNum;
  d2Rdr2ConhNum = - d2rdR2ConhNum*dRdrConhNum*dRdrConhNum*dRdrConhNum;
  d2Thetadr2ConhNum = - d2rdTheta2ConhNum*dThetadrConhNum*dThetadrConhNum*dThetadrConhNum;
  d2Rdh2ConrNum = - d2hdR2ConrNum*dRdhConrNum*dRdhConrNum*dRdhConrNum;
  d2Thetadh2ConrNum = - d2hdTheta2ConrNum*dThetadhConrNum*dThetadhConrNum*dThetadhConrNum;
  d2RdrdhNum = pow(R, - beta*delta)*(2*(- 1 + beta*delta)*Theta*(-1+Theta*Theta)*htil1Num*htil1Num 
      - 2*beta*delta*htil0Num*(htil1Num + Theta*(2*(- 1 + beta*delta)*Theta*htil1Num 
      + (1 - 2*beta*delta)*Theta*htil1Num + (-1+Theta*Theta)*htil2Num)))/(h0*(2*beta*delta*Theta*htil0Num 
      + htil1Num - Theta*Theta*htil1Num)*(- 2*beta*delta*Theta*htil0Num + (-1+Theta*Theta)*htil1Num)
        *(- 2*beta*delta*Theta*htil0Num + (-1+Theta*Theta)*htil1Num));
  d2ThetadrdhNum = beta*delta*pow(R,- 1 - beta*delta)*(2*beta*delta*(1+Theta*Theta)*htil0Num*htil0Num
      - (-1+Theta*Theta)*(-1+Theta*Theta)*htil1Num*htil1Num + (-1+Theta*Theta)*htil0Num
        *(-1+Theta*Theta)*htil2Num)/(h0*(2*beta*delta*Theta*htil0Num + htil1Num
      - Theta*Theta*htil1Num)*(- 2*beta*delta*Theta*htil0Num + (-1+Theta*Theta)*htil1Num)
        *(- 2*beta*delta*Theta*htil0Num + (-1+Theta*Theta)*htil1Num));

  // Derivatives of G wrt r,h
  d2Gdr2ConhNum = d2GdR2Num*dRdrConhNum*dRdrConhNum 
      + d2GdTheta2Num*dThetadrConhNum*dThetadrConhNum 
      + 2*d2GdRdThetaNum*dRdrConhNum*dThetadrConhNum
      + dGdRNum*d2Rdr2ConhNum + dGdThetaNum*d2Thetadr2ConhNum;
  d2Gdh2ConrNum = d2GdR2Num*dRdhConrNum*dRdhConrNum 
      + d2GdTheta2Num*dThetadhConrNum*dThetadhConrNum 
      + 2*d2GdRdThetaNum*dRdhConrNum*dThetadhConrNum
      + dGdRNum*d2Rdh2ConrNum + dGdThetaNum*d2Thetadh2ConrNum;
  d2GdrdhNum = d2GdR2Num*dRdhConrNum*dRdrConhNum
      + d2GdTheta2Num*dThetadhConrNum*dThetadrConhNum 
      + d2GdRdThetaNum*(dRdhConrNum*dThetadrConhNum + dRdrConhNum*dThetadhConrNum)
      + dGdRNum*d2RdrdhNum + dGdThetaNum*d2ThetadrdhNum;

  // Finally, derivative of G wrt muB
  return d2Gdr2ConhNum*drdT*drdT + d2Gdh2ConrNum*dhdT*dhdT 
      + 2*d2GdrdhNum*drdT*dhdT;
}


double d2GdTdmuB(double R, double Theta){

  // gg, htil and derivatives
  gg0Num = c0 + c1*(1-Theta*Theta) + c2*(1-Theta*Theta)*(1-Theta*Theta) + 
        c3*(1-Theta*Theta)*(1-Theta*Theta)*(1-Theta*Theta);
  gg1Num = - 2*c1*Theta - 4*c2*Theta*(1-Theta*Theta) - 6*c3*Theta*(1-Theta*Theta)*(1-Theta*Theta);
  gg2Num = - 2*c1 + c2*(8*Theta*Theta - 4*(1-Theta*Theta)) + c3*(24*Theta*Theta*(1-Theta*Theta)
                                 - 6*(1-Theta*Theta)*(1-Theta*Theta));
  htil0Num = Theta + A*Theta*Theta*Theta + B*Theta*Theta*Theta*Theta*Theta;
  htil1Num = 1 + 3*A*Theta*Theta + 5*B*Theta*Theta*Theta*Theta;
  htil2Num = 6*A*Theta + 20*B*Theta*Theta*Theta;

  // Derivatives of G wrt R, Theta
  d2GdR2Num = h0*M0*(2-alpha)*(1-alpha)*pow(R,-alpha)*(gg0Num - Theta*htil0Num);
  d2GdTheta2Num = h0*M0*pow(R,2.0-alpha)*(gg2Num - 2*htil1Num - Theta*htil2Num);
  d2GdRdThetaNum = h0*M0*(2-alpha)*pow(R,1.0-alpha)*(gg1Num - htil0Num - Theta*htil1Num);
  dGdRNum = h0*M0*(2-alpha)*pow(R,1.0-alpha)*(gg0Num - Theta*htil0Num);
  dGdThetaNum = h0*M0*pow(R,2.0-alpha)*(gg1Num - Theta*htil1Num - htil0Num);

  // Derivatives of Theta wrt R and vice versa at constant r,h
  dThetadRConhNum = -beta*delta*htil0Num/(R*htil1Num);
  dRdThetaConhNum = -R*htil1Num/(beta*delta*htil0Num);
  dThetadRConrNum = (1-Theta*Theta)/(2*Theta*R);
  dRdThetaConrNum = 2*Theta*R/(1-Theta*Theta);

  // Derivatives of r,h wrt R,Theta
  drdRConhNum = 1 - Theta*Theta - 2*R*Theta*dThetadRConhNum;
  drdThetaConhNum = - 2*Theta*R + (1-Theta*Theta)*dRdThetaConhNum;
  dhdRConrNum = beta*delta*h0*pow(R,- 1 + beta*delta)*htil0Num +
                     h0*pow(R,beta*delta)*htil1Num*dThetadRConrNum;
  dhdThetaConrNum = beta*delta*h0*pow(R,- 1 + beta*delta)*htil0Num*dRdThetaConrNum +
                     h0*pow(R,beta*delta)*htil1Num;
  d2rdR2ConhNum = 2*beta*delta*htil0Num/(R*htil1Num*htil1Num*htil1Num)*(htil1Num*(Theta*htil1Num
      - beta*delta*(htil0Num + Theta*htil1Num)) + beta*delta*Theta*htil0Num*htil2Num);
  d2rdTheta2ConhNum = R/(beta*beta*delta*delta*htil0Num*htil0Num)*(- 2*beta*beta*delta*delta*htil0Num*htil0Num
      - (-1+Theta*Theta)*htil1Num*(htil1Num + beta*delta*htil1Num)
      + beta*delta*htil0Num*(4*Theta*htil1Num + (-1+Theta*Theta)*htil2Num));
  d2hdR2ConrNum = h0*pow(R,- 2 + beta*delta)/(4*Theta*Theta*Theta)*(4*beta*delta*(- 1 + beta*delta)*Theta*Theta*Theta
        *htil0Num + (-1+Theta*Theta)*((1 + (3 - 4*beta*delta)*Theta*Theta)*htil1Num
      + Theta*(-1+Theta*Theta)*htil2Num));
  d2hdTheta2ConrNum = h0*pow(R,beta*delta)/((-1+Theta*Theta)*(-1+Theta*Theta))*(2*beta*delta*(1 + (1 + 2*beta*delta)
        *Theta*Theta)*htil0Num + (-1+Theta*Theta)*(- 4*beta*delta*Theta*htil1Num
      + (-1+Theta*Theta)*htil2Num));

  // Derivatives of R,Theta wrt r,h
  dRdrConhNum = 1./drdRConhNum;
  dThetadrConhNum = 1./drdThetaConhNum;
  dRdhConrNum = 1./dhdRConrNum;
  dThetadhConrNum = 1./dhdThetaConrNum;
  d2Rdr2ConhNum = - d2rdR2ConhNum*dRdrConhNum*dRdrConhNum*dRdrConhNum;
  d2Thetadr2ConhNum = - d2rdTheta2ConhNum*dThetadrConhNum*dThetadrConhNum*dThetadrConhNum;
  d2Rdh2ConrNum = - d2hdR2ConrNum*dRdhConrNum*dRdhConrNum*dRdhConrNum;
  d2Thetadh2ConrNum = - d2hdTheta2ConrNum*dThetadhConrNum*dThetadhConrNum*dThetadhConrNum;
  d2RdrdhNum = pow(R, - beta*delta)*(2*(- 1 + beta*delta)*Theta*(-1+Theta*Theta)*htil1Num*htil1Num 
      - 2*beta*delta*htil0Num*(htil1Num + Theta*(2*(- 1 + beta*delta)*Theta*htil1Num 
      + (1 - 2*beta*delta)*Theta*htil1Num + (-1+Theta*Theta)*htil2Num)))/(h0*(2*beta*delta*Theta*htil0Num 
      + htil1Num - Theta*Theta*htil1Num)*(- 2*beta*delta*Theta*htil0Num + (-1+Theta*Theta)*htil1Num)
        *(- 2*beta*delta*Theta*htil0Num + (-1+Theta*Theta)*htil1Num));
  d2ThetadrdhNum = beta*delta*pow(R,- 1 - beta*delta)*(2*beta*delta*(1+Theta*Theta)*htil0Num*htil0Num
      - (-1+Theta*Theta)*(-1+Theta*Theta)*htil1Num*htil1Num + (-1+Theta*Theta)*htil0Num
        *(-1+Theta*Theta)*htil2Num)/(h0*(2*beta*delta*Theta*htil0Num + htil1Num
      - Theta*Theta*htil1Num)*(- 2*beta*delta*Theta*htil0Num + (-1+Theta*Theta)*htil1Num)
        *(- 2*beta*delta*Theta*htil0Num + (-1+Theta*Theta)*htil1Num));

  // Derivatives of G wrt r,h
  d2Gdr2ConhNum = d2GdR2Num*dRdrConhNum*dRdrConhNum 
      + d2GdTheta2Num*dThetadrConhNum*dThetadrConhNum 
      + 2*d2GdRdThetaNum*dRdrConhNum*dThetadrConhNum
      + dGdRNum*d2Rdr2ConhNum + dGdThetaNum*d2Thetadr2ConhNum;
  d2Gdh2ConrNum = d2GdR2Num*dRdhConrNum*dRdhConrNum 
      + d2GdTheta2Num*dThetadhConrNum*dThetadhConrNum 
      + 2*d2GdRdThetaNum*dRdhConrNum*dThetadhConrNum
      + dGdRNum*d2Rdh2ConrNum + dGdThetaNum*d2Thetadh2ConrNum;
  d2GdrdhNum = d2GdR2Num*dRdhConrNum*dRdrConhNum
      + d2GdTheta2Num*dThetadhConrNum*dThetadrConhNum 
      + d2GdRdThetaNum*(dRdhConrNum*dThetadrConhNum + dRdrConhNum*dThetadhConrNum)
      + dGdRNum*d2RdrdhNum + dGdThetaNum*d2ThetadrdhNum;

  // Finally, derivative of G wrt muB
  return d2Gdr2ConhNum*drdT*drdmuB + d2Gdh2ConrNum*dhdT*dhdmuB 
      + d2GdrdhNum*(drdT*dhdmuB + drdmuB*dhdT);
}

